--
-- TOC entry 221 (class 1259 OID 1486793)
-- Name: availarticleindepot; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.availarticleindepot AS
 SELECT article_id,
    (COALESCE(inarticle.totalnumberofpus, (0)::bigint) - COALESCE(outarticle.totalnumberofpus, (0)::bigint)) AS availnumberofpus
   FROM (public.totalnumberpuofallincomingarticles inarticle
     FULL JOIN public.totalnumberpuofalloutgoingarticles outarticle USING (article_id));


